measurements.description:
Ten flowers and six buds on three up to 41.5-cm inflorescences;

sepals and petals green, slightly veined and suffused burgundy;  
lip light yellow, keels yellow, midlobe striped and flushed burgundy proximally, burgundy blotch distally, light yellow margin;
column light yellow, dorsal surface burgundy stripes and spots proximally, light burgundy flush apically,
ventral surface burgundy, anther cap cream;


	substance medium; texture matte.
